import './App.css';

function App() {
  const mensaje = 'Hola mundo, que tal todo? desde variable'
  return (
    <div className="App">
      <h1>Titulo de la App</h1>
      <strong>Estamos trabajando en ello</strong>
      <div>
        <p>El resultado es:</p>
        {mensaje}
      </div>
    </div>
  );
}

export default App;
